import React from 'react';
import ProductList from '../Products/ProductList';
import { Products } from "../../data";

import './Home.css';
const Home = () => {
    return (
        <>  
        <div className="row wrap-picture">
            <div className="col s6 shopmen">
                <img src="/men.jpeg" alt=""/>
                <div className="men">NEW DESIGNS</div>
                <button className="menbtn1">SHOP MEN'S</button>
                <button className="menbtn2">SHOP WOMEN'S</button>
            </div>
            <div className="col s6 shopwomen">
                <img src="/women.jpeg" alt=""/>
                <div className="women">NEW DESIGNS</div>
                <button className="womenbtn1">SHOP MEN'S</button>
                <button className="womenbtn2">SHOP WOMEN'S</button>
            </div>
        </div>
        <div className="container">
            <ProductList items={Products}/>
        </div>
        </>
    )
}

export default Home;
